import React from 'react';
import './Landing.css';

const Landing = () => {
  return (
    <div className="landing" style={{ textAlign: 'center', color: 'white' }}>
      <h1>
        HyperTyper
      </h1>
      Practice your typing smarter, not harder
    </div>
  );
};

export default Landing;
